import React, { Component } from 'react';
import Map from "./Map";
//import TopNavbar from "./TopNavbar";
//import {Container , Row, Col } from 'react-bootstrap';

class Geographical extends Component {
  
  render() {    
    let geographyType  = this.props.match.params.id;
    console.log(geographyType);
    if(geographyType == 1)
    {
      return (      
        <Map isGeographical = {true} geographyType = {"Americas"}/>
      );   
    } 
    if(geographyType == 2)
    {
      return (      
        <Map isGeographical = {true} geographyType = {"Asia Pacific"}/>
      );   
    } 
    if(geographyType == 3)
    {
      return (      
        <Map isGeographical = {true} geographyType = {"Europe"}/>
      );   
    } 
    if(geographyType == 4)
    {
      return (      
        <Map isGeographical = {true} geographyType = {"Middle East And Africa"}/>
      );   
    } 
    if(geographyType == 5)
    {
      return (      
        <Map isGeographical = {true} geographyType = {"Azure Government"}/>
      );   
    } 
  }
  
}

export default Geographical;
